(3, 'Hướng dẫn thanh toán', 'huong-dan-thanh-toan', '<div style=\"text-align: justify;\"><span style=\"font-size: 21px;\"><b>CÁC PHƯƠNG THỨC THANH TOÁN</b></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 21px;\"><b>- Tiền mặt: Thanh toán trực tiếp tại cửa hàng hoặc nhân viên của cửa hàng th', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, 'Chính sách bảo hành', 'chinh-sach-bao-hanh', '<p class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;; font-size: 13px; letter-spacing: normal; background-color: rgb(244, 244, 244);\"><span lang=\"vi\"><b>Hoàng Hà Mobile chân thành cảm ơn ', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, 'Khuyến mãi', 'khuyen-mai', '<h1 style=\"font-size: 36px; font-family: &quot;Open Sans&quot;, sans-serif; font-weight: 400; line-height: 43px; color: rgb(33, 33, 33); letter-spacing: normal; outline: 0px !important;\">Mã giảm giá Hoàng Hà Mobile, khuyến mãi Hoàng Hà Mobile &amp; coupon discount code tháng 8/2022</h1><div><div>Mã giảm giá Hoàng Hà Mobile, voucher khuyến mãi &amp; discount code Hoàng Hà Mobile mới nhất tại Prices.vn; ngoài mã khuyến mãi Hoàng Hà Mobile Prices còn cập nhật nhiều voucher giảm giá, deals, coupons Hoàng Hà Mobile, hướng dẫn sử dụng mã giảm giá Hoàng Hà Mobile, hướng dẫn mua sắm trên Hoàng Hà Mobile</div><div><br></div></div><p style=\"margin-bottom: 10px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; letter-spacing: normal; outline: 0px !important;\"></p>', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, 'mua trả góp', 'ho-tro-tra-gop', '<p></p><h3>I. Trả góp qua Công ty tài chính</h3><p></p><p>Mua hàng trả góp qua các Công ty tài chính là hình thức mua hàng mà khách hàng vay tiền để mua sản phẩm mà không cần thiết phải thế chấp tài sản nhà đất hoặc xe cộ; không cần công chứng giấy tờ.&nbsp;</p><p>Một số sản phẩm nằm trong danh sách mua trả góp 0% của nhà sản xuất sẽ được Hoàng Hà Mobile hỗ trợ khách hàng mua trả góp qua các công ty tài chính như Home Credit hoặc FE Credit.</p><p>1 Hướng dẫn mua hàng trả góp qua Công ty tài chính:</p><p></p><p>Bước 1: Khách hàng mang theo các giấy tờ tùy thân như CMND (thẻ căn cước), Sổ hộ khẩu, GPLX tới cửa hàng Hoàng Hà Mobile gần nhất.</p><p>Bước 2: Nhân viên tư vấn trả góp của công ty tài chính sẽ tư vấn cho khách hàng các gói vay phù hợp với điều kiện kinh tế của khách hàng.</p><p>Bước 3: Nhân viên tài chính sẽ thẩm định hồ sơ cho khách hàng và kí hợp đồng ngay tại cửa hàng (Lưu ý khách cần mang theo bản gốc đề đối chiếu).</p><p>Bước 4: Khách hàng kí hợp đồng và lấy sản phẩm tại cửa hàng.</p><p>Yêu cầu:<br></p><ol><li style=\"margin-left:15.75pt;\"></li></ol><p>Đối tượng hỗ trợ trả góp phải là các cá nhân có độ tuổi từ 20 đến 60 (không hỗ trợ Khách hàng doanh nghiệp)</p><ol><li style=\"margin-left:15.75pt;\"></li></ol><p>CMND (thẻ căn cước) photo 2 mặt</p><ol><li style=\"margin-left:15.75pt;\"></li></ol><p>GPLX hoặc Hộ khẩu thường trú photo 2 mặt</p><ol><li><br></li></ol><p></p><p></p>', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35, 'Dịch vụ', 'dich-vu', '<p>sdsds aaa ho ho iphone 14 sắp ra mắt ròi</p>\n', 1, '2022-09-07 10:26:23', '2022-09-08 03:55:37');

